import React from 'react'
import './Fourth.css'
import { FourthDetail } from './FourthDetail'

export const Fourth = () => {
    return (
        <div className='fourth-container'>
            <FourthDetail icon="pi-check" counter="450" title="Works Completed" />
            <FourthDetail icon="pi-book" counter="4" title="YEARS OF EXPERIENCE" />
            <FourthDetail icon="pi-users" counter="550" title="TOTAL CLIENTS" />
            <FourthDetail icon="pi-trophy" counter="48" title="AWARD WON" />
        </div>
    )
}
